import React, { useState, useEffect } from "react";
import BookCard from "../../components/bookcard/BookCard";

const Books = () => {
  const [books, setBooks] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("https://openlibrary.org/search.json?q=all")
      .then((res) => res.json())
      .then((data) => {
        setBooks(data.docs);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Error fetching books:", err);
        setLoading(false);
      });
  }, []);

  return (
    <main className="books-page">
      {/* Баннер */}
      <section className="books-banner">
        <div className="banner-content">
          <h2>Big stories, small prices - shop the sale!</h2>
          <p>Up to 50% Off - Limited Time Only!</p>
        </div>
      </section>

      <div className="books-layout">
        {/* Левая колонка с фильтрами */}
        <aside className="filters">
          <h3>Category</h3>
          <ul>
            <li>Non-fiction</li>
            <li>Fiction</li>
            <li>Fantasy</li>
            <li>Romance</li>
            <li>Mystery & Thriller</li>
            <li>Science Fiction</li>
            <li>Young Adult</li>
            <li>Children</li>
            <li>Biography</li>
            <li>Self-help</li>
          </ul>

          <h3>Cost</h3>
          <input type="range" min="0" max="50" />

          <h3>Author</h3>
          <input type="text" placeholder="Search" />

          <h3>Language</h3>
          <ul>
            <li>English</li>
            <li>Spanish</li>
            <li>German</li>
            <li>French</li>
            <li>Other</li>
          </ul>

          <h3>Format</h3>
          <ul>
            <li>Hardcover</li>
            <li>Paperback</li>
            <li>Audiobook</li>
            <li>eBook</li>
          </ul>

          <h3>Publication Year</h3>
          <input type="text" placeholder="Search" />
        </aside>

        {/* Правая колонка со всеми книгами */}
        <section className="books">
          {loading ? (
            <div className="loader"></div>
          ) : (
            books.slice(0, 20).map((book) => (
              <BookCard
                key={book.key}
                image={
                  book.cover_i
                    ? `https://covers.openlibrary.org/b/id/${book.cover_i}-M.jpg`
                    : "https://via.placeholder.com/150x220?text=No+Cover"
                }
                rating={Math.floor(Math.random() * 5) + 1}
                title={book.title}
                author={book.author_name ? book.author_name[0] : "Unknown Author"}
                price={Math.floor(Math.random() * 30) + 10}
              />
            ))
          )}
        </section>
      </div>
    </main>
  );
};

export default Books;

